k_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,5,'','',1,11285,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(19,86,'Thai Massage','thai-massage','<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\">Thai Massage facilitates a sense of unity, wholeness, and balance. It creates a dynamic physical experience which integrates the body, mind, emotions and spirit. This ancient therapy is beneficial for young or old, active or inactive, healthy or not so healthy. While each person will respond to this work in terms of their own experience and present state of health, it is well to remember that Thai Massage has been used for countless generations to treat degenerative conditions and promote wellness.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\">Thai Massage uses two primary procedures - applying gentle pressure with the hands and feet, and a wide variety of passive stretching movements. The effect is uniquely relaxing as well as energizing. Receiving a Thai massage is a bit like doing yoga without putting forth any effort while also getting acupressure treatments!</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\">With these techniques, applied in a quietly meditative atmosphere, the body begins to open and regain flexibility and ease of movement, while the mind gently returns to calm alertness. Tension and toxic material is released from the joints, muscles, and connective tissue. The energy bodies, as well as the internal organs, are stimulated by pressure on peripheral reflex points.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 16px;\">The work displays an inherent knowledge of the inner workings of the body, a knowledge that developed over centuries of practice. There is something in the essence of this work that appeals to a wide range of people on a core level; something that satisfies their physical and emotional needs, and perhaps even assists in their spiritual needs.</span></p>','',1,11,'2015-01-30 12:57:15',396,'','2015-02-03 08:44:53',396,0,'0000-00-00 00:00:00','2015-01-30 13:15:15','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,6,'','',1,12390,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(20,87,'Massage FAQ','massage-faq','<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Do you have questions about massage therapy? Here is some massage FAQs that you might find helpful. Each massage therapist works differently, so always ask if you are unsure about anything.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">1: What are the benefits of massage?</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Therapeutic massage helps the body recover from the stresses of strenuous exercise, and facilitates the rebuilding phase of conditioning. The physiological benefits of massage include improved blood and lymph circulation, muscle relaxation, and general relaxation. These, in turn, lead to removal of waste products and better cell nutrition, normalization and greater elasticity of tissues, deactivation of trigger points, and faster healing of injuries. It all adds up to relief from soreness and stiffness, better flexibility, and less potential for future injury.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">In addition to general recovery, massage may also focus on specific muscles used in a sport or fitness activity. For example, areas of greater stress for runners and dancers are in the legs, for swimmers in the upper body, for tennis players in the arms. These areas are more likely to be tight, lose flexibility, and develop trigger points.</span><br style=\"margin: 0px; padding: 0px;\" /> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">2: How many types of massage exist?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">There have dozens of massage styles exist. The exact style is not as important as the intention of the massage therapist. Know what results you want (relaxation, pain relief, injury treatment, etc.) and choose a massage therapist who intends to get those results.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">At Chi-Link we incorporate many kinds of massage styles such as: Chinese, Western, Japanese (Shiatsu) and Thai styles. We offer the Acupressure Massage, Remedial Massage, Sports Massage, Pregnancy Massage, Corporate Massage with deep tissue.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">3: What sorts of people are not suitable for massage?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Although massage has many wonderful benefits, it is not appropriate for people with some medical conditions and sometimes must be used cautiously.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">For example, massage is not recommended if you have a condition involving infection because massage might help the infection spread through your body.</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Obviously, you should not receive massage if you have a contagious condition. If you have a skin rash, know what it is before your massage, because some skin conditions are contagious.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">4: What are the effects of chronic muscle tension?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Chronic muscle tension inhibits circulation, which means your muscles aren’t receiving the nutrition they need and waste products aren’t being taken away. The lack of nutrition and toxic build-up of waste irritate nerve endings, resulting in weakness and pain. This toxicity also taxes your immune system. Chronic muscle tension also inhibits movement. Chronic muscle tension also uses up energy, so you fatigue more easily.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">5: How long do the effects of massage last? How often should I receive massage?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">The duration of the effects of a massage vary greatly from person to person depending on your physical and mental condition, activities, ability to relax, and ability to heal. If you are receiving massage to help heal injury or to get rid of chronic pain, you usually need to receive weekly massage until you reach that goal.</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">6: What is the approach of a massage?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">It depends on the techniques used. In general a massage session may start with broad, flowing strokes which will help to calm your nervous system and relax exterior muscle tension. As your body becomes relaxed, pressure will gradually be increased to relax specific areas and relieve areas of muscular tension. You should communicate immediately if you feel any discomfort so that another approach may be taken. Massages are most effective when your body is not resisting.</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">7: What should I do during the massage session?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Make yourself comfortable. The practitioner will either gently move you or tell you what is needed throughout the session. Many people just close their eyes and completely relax. Feel free to ask the practitioner questions about massage in general or about the particular technique you are receiving.</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">8: Where will my massage session take place?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Environment is important to the massage experience. Your massage session at Chi-Link will take place in a warm, comfortable, quiet room. If the desired experience is to be relaxing, then having low-level lighting, soft music, and a pleasing aroma all add to the effect.</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial;\">9: How will I feel after the massage?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Everybody responds differently to massage. If the Chi (Qi) energy and meridian blockages are stimulated, dormant toxins flow back into circulation to be eliminated via the normal channels. The organs of elimination include the liver, lungs, kidneys, lymphatic system and skin. If the bodies’ eliminatory and healing mechanisms are a little sluggish, or the recipient is particularly sensitive, symptoms including light-headedness and headaches, lethargy and sleepiness can occur.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Deep tissue or injury treatment massage may leave you feeling sore for a day or two. Always let your massage therapist know how you felt, so he or she can adjust the massage as needed.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">It seems that those who lead a healthier, cleaner lifestyle have less reaction and those that tend to eat poorly, do little physical activity and lead a sedentary lifestyle will be more sensitive to this shift. It is important to remember that these physical and emotional reactions are temporary and that the body will balance itself soon after.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; font-family: Arial; color: #64451d;\">Drinking water facilitates the healing process and each and every massage after the initial one will produce a more positive reaction. After the initial period of feeling slowed down, people often experience increased energy, heightened awareness, and greater productivity which can last for days.</span></p>','',1,11,'2015-01-30 12:58:36',396,'','2015-02-03 08:45:06',396,0,'0000-00-00 00:00:00','2015-01-30 13:20:36','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,4,'','',1,6679,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(21,88,'Ear Candling','ear-candling','<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">\"Ear candling,\" also known as auricular candling or coning, refers to various procedures that involve placing a cone-shaped device in the ear canal and supposedly extracting earwax and other impurities with the help of smoke or a burning wick. The origins of candling are obscure. Ancient Tibet, China, Egypt, the pre-Columbian Americas, and even the mythical city of Atlantis are cited as possible contributors. </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">The procedures supposedly create a low-level vacuum that draws wax and other debris out of the ear canal. Some proponents even claim that impurities are removed from the inner ear, the facial sinuses, or even the brain itself, all of which are somehow connected to the canal. </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #0000