style=\"margin: 0px; padding: 0px;\"> </span><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">purify the blood,</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">•</span><span class=\"Apple-tab-span\" style=\"margin: 0px; padding: 0px;\"> </span><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">act as an anti-inflammatory, antiseptic, or antibiotic</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">•</span><span class=\"Apple-tab-span\" style=\"margin: 0px; padding: 0px;\"> </span><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">cure Meniere\'s syndrome</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">•</span><span class=\"Apple-tab-span\" style=\"margin: 0px; padding: 0px;\"> </span><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">aid sinusitis</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">•</span><span class=\"Apple-tab-span\" style=\"margin: 0px; padding: 0px;\"> </span><span style=\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\">release blocked energy</span></p>','',1,11,'2015-01-30 12:59:28',396,'','2015-02-03 08:44:02',396,0,'0000-00-00 00:00:00','2015-01-30 13:12:28','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,3,'','',1,5773,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(22,89,'Relaxation massage','relaxation-massage','<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px; color: #64451d;\">Massage helps the body recover from the stresses of strenuous exercise, and facilitates the rebuilding phase of conditioning. The physiological benefits of massage include improved blood and lymph circulation, muscle relaxation, and general relaxation. These, in turn, lead to removal of waste products and better cell nutrition, normalization and greater elasticity of tissues, deactivation of trigger points, and faster healing of injuries. It all adds up to relief from soreness and stiffness, better flexibility, and less potential for future injury.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px; color: #64451d;\"><span style=\"margin: 0px; padding: 0px; font-family: Verdana;\">In addition to general recovery, massage may also focus on specific muscles used in a sport or fitness activity. For example, areas of greater stress for runners and dancers are in the legs, for swimmers in the upper body, for tennis players in the arms. These areas are more likely to be tight, lose flexibility, and develop trigger points.</span></span></p>','',1,11,'2015-01-30 13:00:10',396,'','2015-02-03 08:44:18',396,396,'2016-09-23 08:51:00','2015-01-30 13:14:10','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,2,'','',1,24235,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(23,90,'Cupping','cupping','<p><span style=\"color: #64451d; font-family: Arial; font-size: 18px; line-height: normal;\">Cupping is used frequently and complements acupuncture and massage. Suction cups placed at various points on the body create a vacuum that draws toxins to the surface of the skin. This stimulates the person\'s protective energy and consequently their immune system because skin has the richest circulation it clears toxins quickly and efficiently.</span></p>\r\n<p> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">1: What does cupping do?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">Cupping has the function of warming and promoting the flow of energy in the blood this dispelling cold dampness, toxic and winds. It is also diminishing swellings and pains.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">2: What kinds of problems can cupping cure?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">Cupping responded very well with the following problems: Diseases caused by dampness, such as low back pain, lumbago, sciatica, pain the arms and shoulders, pain in the legs and muscular part of the body, stomachache, vomiting, headache, migraine, sprains, insomnia etc.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">3: What are the tools used in cupping treatment?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">Ancient time people will use animal horn to suck out the pus, or they will use bamboo jar. Modern time we use glass jars which are easy to clean and easy to monitor the cupping progress. We use alcohol soaked cotton ball, ignite it and put it into the cup to create a vacuum then remove the cotton ball immediately and place the cup on selected position.</span></p>\r\n<p style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">4: What would happen after the cupping?</span><br style=\"margin: 0px; padding: 0px;\" /><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">There is no pain involved during and after cupping. Usually if there is stagnation then the skin on the cupping area will becomes congested with violet colored blood stasis formation. It\'ll look like big hickies which will go away few days later.</span></p>\r\n<p style=\"margin: 0px; padding: 0px;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px;\"> </p>','',1,11,'2015-01-30 13:00:48',396,'','2015-02-03 08:43:38',396,0,'0000-00-00 00:00:00','2015-01-30 13:11:48','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,1,'','',1,6277,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(24,91,'Acupuncture','acupuncture','<h3 class=\"MsoNormal\" style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">Acupressure massage therapy stimulates and activates the body\'s own energies to help fight illness and restore harmony. Some of the Acupressure points are significant as they relate to a specific part of the body while others are more general in their effect. Various ailments such as tension and stress, aches and pains, arthritis or menstrual cramps can be alleviated. Acupressure can also be used for general preventative health care.</span></h3>\r\n<p> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\">1: Is Acupuncture useful for curing my cold and cough? </span></strong></span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">Acupuncture and herbal medicine can be an effective complement to your treatment. Acupuncture redirects your Chi or vital energy into a more balanced flow. It provides support to the underlying energetic spheres affected by poor digestion and lack of movement. Acupuncture releases tension in the muscles. This allows increased flow of blood, lymph, and nerve impulses to affected areas, decreasing the stress experienced by you.</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\"> </span></span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\">2: Can Acupuncture help my smoke addiction?</span></strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\"> </span><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\"> </span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">From the results of clinical and basic research, there is clear evidence that acupuncture analgesia is closely associated with the nervous system, especially the central nervous system.</span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">Stimulation of certain acupuncture loci which have been used for analgesia during operations also can calm the withdrawal symptoms of morphine and heroin addicts. Acupuncture analgesia can be antagonized by the specific narcotic antagonist, naloxone. Stimulation would also have agonist activity on opiate receptors. Moreover, the morphine receptors are most concentrated in those parts of the brain concerned with perception of pain and the pathway of acupuncture stimulation.</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\"> </span></span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\">3: Does Acupuncture for Weight Loss Work?</span></strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\"><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\">Yes, acupuncture can be a wonderful support to the process of losing weight, or making other behavioural changes; and, at the same time, it creates balance and harmony in the whole person. Acupuncture is not, however, a magic bullet. If there were a single acupuncture point for weight loss or smoking cessation, acupuncturists would be millionaires!</span><br style=\"margin: 0px; padding: 0px;\" /><span style=\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\"> </span></span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\">4. Are the needles reused?</span></strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; line-height: 19.260000228881836px; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; color: #64451d;\">Acupuncturists today use sterilized, individually packaged, disposable needles to </span></span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; line-height: 19.260000228881836px; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; color: #64451d;\">avoid the possibility of transmitting communicable diseases.</span></span></p>\r\n<p> </p>\r\n<p style=\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\"> </p>','',1,11,'2015-01-30 13:01:22',396,'','2015-02-03 08:43:26',396,0,'0000-00-00 00:00:00','2015-01-30 13:10:22','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"