ntro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_layout\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":29,\"ordering\":\"6\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"130\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\"}',0),(73,24,1,'','2015-02-03 08:29:05',396,8030,'fba9b2e327e55548833c6f721c1706bf2c7e66dd','{\"id\":24,\"asset_id\":\"91\",\"title\":\"Acupuncture\",\"alias\":\"acupuncture\",\"introtext\":\"<h3 class=\\\"MsoNormal\\\" style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">Acupressure massage therapy stimulates and activates the body\'s own energies to help fight illness and restore harmony. Some of the Acupressure points are significant as they relate to a specific part of the body while others are more general in their effect. Various ailments such as tension and stress, aches and pains, arthritis or menstrual cramps can be alleviated. Acupressure can also be used for general preventative health care.<\\/span><\\/h3>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\\\">1: Is Acupuncture useful for curing my cold and cough?\\u00a0<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">Acupuncture and herbal medicine can be an effective complement to your treatment. Acupuncture redirects your Chi or vital energy into a more balanced flow. It provides support to the underlying energetic spheres affected by poor digestion and lack of movement. Acupuncture releases tension in the muscles. This allows increased flow of blood, lymph, and nerve impulses to affected areas, decreasing the stress experienced by you.<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">\\u00a0<\\/span><\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\\\">2: Can Acupuncture help my smoke addiction?<\\/span><\\/strong><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">\\u00a0<\\/span><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">\\u00a0<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">From the results of clinical and basic research, there is clear evidence that acupuncture analgesia is closely associated with the nervous system, especially the central nervous system.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">Stimulation of certain acupuncture loci which have been used for analgesia during operations also can calm the withdrawal symptoms of morphine and heroin addicts. Acupuncture analgesia can be antagonized by the specific narcotic antagonist, naloxone. Stimulation would also have agonist activity on opiate receptors. Moreover, the morphine receptors are most concentrated in those parts of the brain concerned with perception of pain and the pathway of acupuncture stimulation.<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">\\u00a0<\\/span><\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\\\">3: Does Acupuncture for Weight Loss Work?<\\/span><\\/strong><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: \'font-size:10pt;} \';\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">Yes, acupuncture can be a wonderful support to the process of losing weight, or making other behavioural changes; and, at the same time, it creates balance and harmony in the whole person. Acupuncture is not, however, a magic bullet. If there were a single acupuncture point for weight loss or smoking cessation, acupuncturists would be millionaires!<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">\\u00a0<\\/span><\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: Arial; font-size: 18px;\\\">4. Are the needles reused?<\\/span><\\/strong><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; line-height: 19.260000228881836px; font-size: 18px;\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d;\\\">Acupuncturists today use sterilized, individually packaged, disposable needles to\\u00a0<\\/span><\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; line-height: 19.260000228881836px; font-size: 18px;\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d;\\\">avoid the possibility of transmitting communicable diseases.<\\/span><\\/span><\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\">\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"11\",\"created\":\"2015-01-30 13:01:22\",\"created_by\":\"396\",\"created_by_alias\":\"\",\"modified\":\"2015-02-03 08:29:05\",\"modified_by\":\"396\",\"checked_out\":\"396\",\"checked_out_time\":\"2015-02-03 08:28:19\",\"publish_up\":\"2015-01-30 13:01:22\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_layout\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"0\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"3\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\"}',0),(74,23,1,'','2015-02-03 08:30:35',396,5482,'15a6279c9c06b59866458ef9c7b2df98f2974e6b','{\"id\":23,\"asset_id\":\"90\",\"title\":\"Cupping\",\"alias\":\"cupping\",\"introtext\":\"<p><span style=\\\"color: rgb(100, 69, 29); font-family: Arial; font-size: 18px; line-height: normal;\\\">Cupping is used frequently and complements acupuncture and massage. Suction cups placed at various points on the body create a vacuum that draws toxins to the surface of the skin. This stimulates the person\'s protective energy and consequently their immune system because skin has the richest circulation it clears toxins quickly and efficiently.<\\/span><\\/p>\\r\\n<p><img src=\\\"images\\/Services\\/a.jpg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">1: What does cupping do?<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">Cupping has the function of warming and promoting the flow of energy in the blood this dispelling cold dampness, toxic and winds. It is also diminishing swellings and pains.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: arial, simsun, sans-serif; line-height: normal;\\\"><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">2: What kinds of problems can cupping cure?<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">Cupping responded very well with the following problems: Diseases caused by dampness, such as low back pain, lumbago, sciatica, pain the arms and shoulders, pain in the legs and muscular part of the body, stomachache, vomiting, headache, migraine, sprains, insomnia etc.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: arial, simsun, sans-serif; line-height: normal;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">3: What are the tools used in cupping treatment?<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">Ancient time people will use animal horn to suck out the pus, or they will use bamboo jar. Modern time we use glass jars which are easy to clean and easy to monitor the cupping progress. We use alcohol soaked cotton ball, ignite it and put it into the cup to create a vacuum then remove the cotton ball immediately and place the cup on selected position.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\"><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">4: What would happen after the cupping?<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: rgb(100, 69, 29); font-family: Arial; font-size: 18px;\\\">There is no pain involved during and after cupping. Usually if there is stagnation then the skin on the cupping area will becomes congested with violet colored blood stasis formation. It\'ll look like big hickies which will go away few days later.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: arial, simsun, sans-serif; line-height: normal;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"11\",\"created\":\"2015-01-30 13:00:48\",\"created_by\":\"396\",\"created_by_alias\":\"\",\"modified\":\"2015-02-03 08:30:35\",\"modified_by\":\"396\",\"checked_out\":\"396\",\"checked_out_time\":\"2015-02-03 08:29:22\",\"publish_up\":\"2015-01-30 13:00:48\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\"