g the flow of energy in the blood this dispelling cold dampness, toxic and winds. It is also diminishing swellings and pains.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">2: What kinds of problems can cupping cure?<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">Cupping responded very well with the following problems: Diseases caused by dampness, such as low back pain, lumbago, sciatica, pain the arms and shoulders, pain in the legs and muscular part of the body, stomachache, vomiting, headache, migraine, sprains, insomnia etc.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">3: What are the tools used in cupping treatment?<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">Ancient time people will use animal horn to suck out the pus, or they will use bamboo jar. Modern time we use glass jars which are easy to clean and easy to monitor the cupping progress. We use alcohol soaked cotton ball, ignite it and put it into the cup to create a vacuum then remove the cotton ball immediately and place the cup on selected position.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\"><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">4: What would happen after the cupping?<\\/span><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><br style=\\\"margin: 0px; padding: 0px;\\\" \\/><span style=\\\"margin: 0px; padding: 0px; color: #64451d; font-family: Arial; font-size: 18px;\\\">There is no pain involved during and after cupping. Usually if there is stagnation then the skin on the cupping area will becomes congested with violet colored blood stasis formation. It\'ll look like big hickies which will go away few days later.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"11\",\"created\":\"2015-01-30 13:00:48\",\"created_by\":\"396\",\"created_by_alias\":\"\",\"modified\":\"2015-02-03 08:31:41\",\"modified_by\":\"396\",\"checked_out\":\"396\",\"checked_out_time\":\"2015-02-03 08:30:57\",\"publish_up\":\"2015-01-30 13:00:48\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_layout\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":3,\"ordering\":\"1\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"6\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\"}',0),(76,22,1,'','2015-02-03 08:32:22',396,3213,'77f689c2220f61f5311bb5b15a8b8aef61e74d4c','{\"id\":22,\"asset_id\":\"89\",\"title\":\"Relaxation massage\",\"alias\":\"relaxation-massage\",\"introtext\":\"<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 24px; color: #64451d;\\\">Massage helps the body recover from the stresses of strenuous exercise, and facilitates the rebuilding phase of conditioning. The physiological benefits of massage include improved blood and lymph circulation, muscle relaxation, and general relaxation. These, in turn, lead to removal of waste products and better cell nutrition, normalization and greater elasticity of tissues, deactivation of trigger points, and faster healing of injuries. It all adds up to relief from soreness and stiffness, better flexibility, and less potential for future injury.<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 24px; color: #64451d;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: Verdana;\\\">In addition to general recovery, massage may also focus on specific muscles used in a sport or fitness activity. For example, areas of greater stress for runners and dancers are in the legs, for swimmers in the upper body, for tennis players in the arms. These areas are more likely to be tight, lose flexibility, and develop trigger points.<\\/span><\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"11\",\"created\":\"2015-01-30 13:00:10\",\"created_by\":\"396\",\"created_by_alias\":\"\",\"modified\":\"2015-02-03 08:32:22\",\"modified_by\":\"396\",\"checked_out\":\"396\",\"checked_out_time\":\"2015-02-03 08:31:52\",\"publish_up\":\"2015-01-30 13:00:10\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_layout\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"2\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"4\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\"}',0),(77,21,1,'','2015-02-03 08:32:56',396,13326,'95749cbb9d33466d15cbb48637eae0647994f395','{\"id\":21,\"asset_id\":\"88\",\"title\":\"Ear Candling\",\"alias\":\"ear-candling\",\"introtext\":\"<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\">\\u00a0<\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\\"Ear candling,\\\" also known as auricular candling or coning, refers to various procedures that involve placing a cone-shaped device in the ear canal and supposedly extracting earwax and other impurities with the help of smoke or a burning wick. The origins of candling are obscure. Ancient Tibet, China, Egypt, the pre-Columbian Americas, and even the mythical city of Atlantis are cited as possible contributors.\\u00a0<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal; text-align: justify;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u00a0<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal; text-align: justify;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">The procedures supposedly create a low-level vacuum that draws wax and other debris out of the ear canal. Some proponents even claim that impurities are removed from the inner ear, the facial sinuses, or even the brain itself, all of which are somehow connected to the canal.\\u00a0<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal; text-align: justify;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u00a0<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u00a0<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">What can ear candling do for me?<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u2022<\\/span><span class=\\\"Apple-tab-span\\\" style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/span><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">relieve sinus pressure and pain<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u2022<\\/span><span class=\\\"Apple-tab-span\\\" style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/span><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">cleanse the ear canal<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u2022<\\/span><span class=\\\"Apple-tab-span\\\" style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/span><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">improve hearing<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u2022<\\/span><span class=\\\"Apple-tab-span\\\" style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/span><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">assist lymphatic circulation<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u2022<\\/span><span class=\\\"Apple-tab-span\\\" style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/span><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">regulate pressure<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">\\u2022<\\/span><span class=\\\"Apple-tab-span\\\" style=\\\"margin: 0px; padding: 0px;\\\">\\u00a0<\\/span><span style=\\\"margin: 0px; padding: 0px; font-size: 18px; color: #64451d;\\\">purify the mind<\\/span><\\/p>\\r\\n<p style=\\\"margin: 0px; padding: 0px; color: #000000; font-family: arial, simsun, sans-serif; line-height: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: